import styled from 'styled-components'
import pHeader from './components/provider/pHeader'
import { Component } from 'react'
import pRouter from './Routes/pRouter'


class Provider extends Component{
  render(){
    return(
      <>
        <pHeaderLayout>
          <pHeader/>
        </pHeaderLayout>
        <pBodyLayout>
          <pRouter/>
        </pBodyLayout>
      </>
    )
  }
}

export default Provider;

const pHeaderLayout = styled.div`
  margin: 0 auto;
  display: flex;
  width: 100vw;
  flex-flow : row wrap;
`
const pBodyLayout = styled.div`
  margin: 0 auto;
  display: flex;
  width: 100%;
  flex-flow : row wrap;
`
